import { Link } from "react-router-dom";
import React, { Component, Fragment, useEffect, useState } from "react";
import ClasificacionRadicadoApi from "../../Api/Services/ClasificacionRadicadoApi";

import { ErrorMessage, Field, Form, Formik } from 'formik';
import { useParams } from "react-router";
import { Navigate } from "react-router-dom";
import Spinner from '../../Utils/Spinner';
import InfoErrorApi from '../../Utils/InfoErrorApi';
import InfoExitoApi from '../../Utils/InfoExitoApi';



class ClasificacionRadicado extends Component {

    constructor(props) {
        super(props);

        const { getIdProcesoDisciplinario } = this.props;
        const { getIdEtapa } = this.props;


        this.estado_proceso = {
            id_proceso_disciplinario: getIdProcesoDisciplinario,
            id_etapa: getIdEtapa
         
        };


        console.log("PROCESO DISCIPLINARIO: "+getIdProcesoDisciplinario)
        console.log("ETAPA: "+getIdEtapa)

        const [errorApi, setErrorApi] = useState('');
        
        
    }

    render() {


        return (
            <Fragment>


                <div className='col-md-9 text-right'>

                    <>
                        <h1> Hola Sandra {this.estado_proceso.id_proceso_disciplinario}</h1>


                        <Spinner />
                        {<InfoExitoApi />}

                        <div className="row">

                            <div className="col-md-12">
                                <div className="block block-rounded block-bordered">
                                    <div className="block-content">
                                        <nav aria-label="breadcrumb">
                                            <ol className="breadcrumb breadcrumb-alt push">
                                                <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/MisPendientes`}><small>Mis Pendientes</small></Link></li>
                                                <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/RamasProceso/`}><small>Ramas del proceso</small></Link></li>
                                                <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" aria-current="page" to={`/ClasificacionRadicadoLista/`}><small>Clasificacion del radicado Lista</small></Link></li>
                                                <li class="breadcrumb-item"> <small>Nueva clasificacion del radicado</small></li>
                                            </ol>
                                        </nav>
                                    </div>
                                </div>
                            </div>
                        </div>

                    </>
                        
                </div>
            </Fragment>
        );
    }
    
}

export default ClasificacionRadicado;
